post.description:
Update the station strategy policy.The strategyType and the deviceId(deviceId allows null) form a unique key. If the station strategy policy exists, it is updated, otherwise it is created.
```
{
    "strategyType":"AUTOMATIC",//Main strategy, default off
    "stationId":"xxxxx",
    "enable":true,//strategy enable:1-on 0-off
    "version":"1" //strategy version:1
}
```
```
{
    "strategyType":"ENERGY_TRADING",//Grid sell strategy
    "stationId":"xxxxx",
    "enable":true,
    "version":"1"
}
```
```
{
    "strategyType": "DEMAND_CHARGE",//Grid demandCharge strategy
    "stationId": "xxxx",
    "enable": true,
    "version": "1",
    "expandParam":{
        "targetCapacity":20,//target power (kW)
        "times":[
            {
                "start":"08:00",
                "end":"16:00"
            }
        ]
    }
}
```
```
{
    "strategyType": "SMART_CHARGING",//Charging pile intelligent strategy
    "stationId": "xxxx",
    "deviceId": "XXX",
    "enable": true,
    "version": "1",
    "expandParam": {
        "plan": [
            {
                "startTime": "2024-05-05T10:00:00Z",
                "endTime": "2024-05-05T18:30:00Z",
                "targetEnergy": 20 //target Energy (kWh)
            }
        ]
    }
}
```
```
{
    "strategyType": "SMART_HEATING",//Hvac Intelligent strategy
    "stationId": "xxxx",
    "deviceId": "XXX",
    "enable": true,
    "version": "1",
    "expandParam": {
        "setLowerTemp": 23.5,//Lower limit temperature 
        "setUpperTemp": 25,//Upper limit temperature
        "currentMode": "HEAT" //current mode：HEAT、COOL、AUTO、OFF
    }
}
```

